ControlPropertyState.AutoRuleBindingString:
// Ensure a student is selected
If(
    IsBlank(varSelectedStudent),
    Notify("No student selected. Please select a student to check in.", NotificationType.Warning),
    
    // Otherwise patch the scan
    With(
        {
            result: Patch(
                Student_Scans,
                Defaults(Student_Scans),
                {
                    Student_QR: varSelectedStudent.cree6_idname,
                    ScanType: "mCheck In",
                    SS_Class: varSelectedStudent.Class
                }
            )
        },
        If(
            IsError(result),
            Notify("Check In failed. Please check connection and try again.", NotificationType.Error),
            Notify(
                varSelectedStudent.cree6_idname & " checked in successfully.",
                NotificationType.Success
            )
        )
    )
);

// Update local variables after patch
Set(
    varLastScan,
    {
        ScanType: "Manual Check In",
        CreatedOn: Now(),
        PickUpPerson: Blank()
    }
);

